package expression.generic;public class GenericMin<T> extends GenericOperation<T> {    public GenericMin(GenericGeneralExpression<T> first, GenericGeneralExpression<T> second, NumberMode<T> calculator) {        super.first = first;        super.second = second;        super.sign = " min ";        super.calculator = calculator;    }    public T operation(T first, T second) {        return calculator.min(first, second);    }}